    <div className="joinOuterContainer">
      <div className="joinInnerContainer">
        <h1 className="heading">Join</h1>
        <div>
          <input
            placeholder="Name"
            className="joinInput"
            type="text"
            onChange={(event) => props.setName(event.target.value)}
          />
        </div>
        <button className={"button mt-20"} type="submit" onClick={props.join}>
          Start!
        </button>
      </div>
    </div>
  );
};
